import React from 'react'

function App() {
  const date = new Date()
  const hours = date.getHours()
  let timeOfDay

  if (hours < 12) {
    timeOfDay = "morning"
  } else if (hours >= 12 && hours < 17) {
    timeOfDay = "afternoon"
  } else {
    timeOfDay = "night"
  }

  return(
    <div>
      <h1 style={{color: "#FF8C00"}, {backgroundColor: "#FF2D00"}}>Good {timeOfDay}!</h1>
    </div>
  )
}

export default App
